% Calculate shifts
shift_mesh_points = zeros(size(mesh_points));
aux_x = 0; aux_y = 0; aux_z = 0;
for j = 1:nDimY
   for k = 1:nDimZ
       bernstein_yz = bernstein_y(j,:) .* bernstein_z(k,:);
       for i = 1:nDimX
          aux = bernstein_x(i,:) .* bernstein_yz;
          aux_x = aux_x + aux .* 0; % We aren't deforming in X
          aux_y = aux_y + aux .* deformation(i, j, k);
          aux_z = aux_z + aux .* 0; % We aren't deforming in Z
       end
   end
end
shift_mesh_points(:,1) = aux_x(:);
shift_mesh_points(:,2) = aux_y(:);
shift_mesh_points(:,3) = aux_z(:);

% Apply shifts, unscale, order according to XFoil format
newMeshPoints = mesh_points + shift_mesh_points(:,[1 2 3]);
newMeshPoints(:,2) = newMeshPoints(:,2)*yHeight+yOrigin;
%newMeshPoints = orderFoil(newMeshPoints);
newMeshPoints = newMeshPoints(:,[1 2])';


